import { Box } from "@mui/material";
import React from "react";

function Leftbar() {
  return (
    <Box
      bgcolor="blue"
      flex={1}
      p={2}
      sx={{ display: { xs: "none", sm: "block" } }}
    >
      Leftbar
    </Box>
  );
}

export default Leftbar;
